import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import {windowListener, burgerClick} from './scripts/myscripts.js';
import { useEffect } from 'react';
import mobStyles from './styles/phone.module.css';

function Menu(props) {

  useEffect(()=>{
    windowListener();
    burgerClick();
  });
  
  return (
    <div className='container-fluid'>
      <div className='row'>
        <div className='col-12 menuBar'>
          <div id="compBar">
            <Link to="./"><button className='menuBut'>Home</button></Link>
            <Link to="./profile"><button className='menuBut'>Profile</button></Link>
            <Link to="./login"><button className='menuBut'>Create Account</button></Link>
            <Link to="./login"><button className='menuBut'>Log In</button></Link>
          </div>
            
        </div>
        <div className='col-12 phoneBar'>
        <div id="phoneBar" className='col-3'>
            <div id="burger">
            <div className="patty"></div>
            <div className="patty"></div>
            <div className="patty"></div>
            </div>
            </div> 
        <div id="phoneBarMenu" className='d-flex flex-column align-items-center'>
              <Link to="./"><button className={`${mobStyles.menuBut} pt-5`}>Home</button></Link>
              <Link to="./profile"><button className={mobStyles.menuBut}>Profile</button></Link>
              <Link to="./login"><button className={mobStyles.menuBut}>Create Account</button></Link>
              <Link to="./login"><button className={`${mobStyles.menuBut} pb-5`}>Log In</button></Link>
            </div>
            </div>
      </div>
    </div>
  );
}

export default Menu;
